('ZMA4049', 'ZMA', 'https://shopee.co.id/Uno-Stacko-Merah-i.16716304.147002278?toko=ZMA?toko=ZMA', '', '', 'Uno Stacko Merah', 'ZMA4049 - Uno Stacko Merah', 'tersedia', '45000', '75000', '105000', '28', 'Istanatoys official shop', '', '', '[\"https:\\/\\/cf.shopee.co.id\\/file\\/a18523b1b5e12bf3d0d9fc24cbb5bc92\"]', 'Uno Stacko Permainan menyusun balok-balok membentuk menara dengan mengambi balok dari dari bagian bawah atau tengah menara dan meletakkannya di puncak menara secara bergantian tanpa boleh merobohkan menara atau menjatuhkan balok lain.  Manfaat: Kognitif kemampuan mengetahui dan mengingat. Motorik kemampuan mengkoordinasikan anggota tubuh seperti tangan dan kaki. Logika kemampuan berpikir secara tepat dan teratur. Emosional/Sosial kemampuan merasakan dan menjalin hubungan interpersonal. Kreatif/Imajinatif kemampuan menghasilkan ide sesuai dengan konteks. Visual kemampuan mata menangkap bentuk dan warna obyek. \n\nCara Memainkan: Siapkan menara UNO Stacko yg ada. Permainan ini untuk 2-10 pemain. Pemain pertama mengambil sebuah balok dari bagian bawah atau tengah menara dan meletakkannya di bagian atas menara. Pemain berikutnya harus mengambil balok dengan warna yg sama dengan nomor apa saja atau balok dengan angka yg sama dengan warna apa saja. Apabila balok dengan tanda \'reserve\' dipindahkan maka arah permainan dibalik. Sedangkan balok tanda \'draw two\' mengharuskan pemain memindahkan 2 balok langsung ke atas menara. Balok dengan tanda \'skip\' berarti pemain tsb dilewati oleh pemain berikutnya. Dan ketika balok warna ungu diambil maka pemain tsb harus menyebutkan warna balok apa yg harus diambil pemain berikutnya. Permainan berakhir apabila menara roboh dan pemain yg menyebabkan robohnya menaralah yg kalah. \nmerk JAP \n\nblom dapat dadu\n\n   #unostacko #uno #unoboardgame #unokayu #permainanlucu #mainananak #mainaanbayi #istanatoys', 'https://cf.shopee.co.id/file/a18523b1b5e12bf3d0d9fc24cbb5bc92', 'https://cf.shopee.co.id/file/', 0, NULL),
