on can be turned off. This means that the watch no longer beeps when switching from one function to another. Preset alarm or countdown timers remain active when the button tones are deactivated.\nAutomatic calendar\nOnce set, the automatic calendar always displays the correct date.\n12/24-hour timekeeping\nTimes can be displayed in either a 12-hour or 24-hour format.\nResin case\nResin band\nSynthetic resin is the ideal material for wrist straps thanks to its extremely durable and flexible properties.\nLong Battery Life\n10 years, 1 battery. Newly developed electronics ensure significantly lower energy consumption.\nWater resistance classification (10 bar)\nPerfect for swimming and snorkelling: the watch is water resistant to 10 bar / 100 metres. The metres value does not relate to a diving depth but to the air pressure use\n\nFitur	                                                        Stopwatch\nMaterial kaca jam	                                Mineral glass\nModel	                                                        AE-1100W-1AVDF\nMovement	                                                Digital\nTempat pembuatan pergerakan jam	China\nUkuran (L x W x H cm)	                        48.1Ã—43.7Ã—13.7mm\nUkuran case dalam mm	                        40mm to 44mm\nAnti Air	                                                        100M-200M', 'https://cf.shopee.co.id/file/7cbdb85161386ec191593a6305389879', 'https://cf.shopee.co.id/file/0ec10946ed60f6682929bac5f0dc4a98', 0, NULL),
