panjang yang bisa diatur, dikemas dengan bahan canvas tidak mudah tembus air (waterproof), serta desain yang berbeda dengan tas selempang lainnya.\n\nKompartemen Luas\nRansel ini memiliki 1 kompartemen utama yang tentunya akan sangat berguna untuk Anda. Dengan tas ini, Anda dapat membawa berbagai barang-barang kebutuhan Anda ketiga bepergian tanpa harus kekurangan ruang.\n\nTerbuat dari Kanvas\nTas travel ini terbuat dari material dengan mutu yang baik, yaitu dari kanvas, sehingga dapat memungkinkan tas travel untuk bertahan lebih lama. Selain itu, retsletingnya pun terbuat dari bahan yang sangat kuat.\n\n\nFitur Tas :\n- Ransel selempang, \n- Busa punggung yang empuk, \n- Sekat Gadget\n- Design Modis\n\nUkuran : 18 x 6 x 33 \n\n\n\n#backpack #tasselempang #backpack #tasfashion #slingbag #fashion #fashionpria #fashionwanita #pia #wanita #murah #gratisongkir #tasfashion #backpack  #tasmurah #slempangwanita #gratisongkir #gratisongkir #taspria #taswanita #backpack #tasfashionkorea  #taskorea #tascowok #backpack #slingbag #tasselempang #tascowok #gratisongkir #tasmurah #freeongkir #taspria #tasanak #taspria #bestseller #gratisongkir #dibawah100rb #taspria #dibawah100rb #slingbag #tascowok #gratisongkir #tasimport #tasmurah #murah #backpack #ransel #backpack #fashionwanita #gratisongkir #handbag #murah #tasfashion #tasimport #tasselempang #tasfashion #murah #tasselempang #tasbranded #handbag #murah #taspria #gratisongkir #fashion #taspria #murah #gratisongkir #fashion #tasmurah  #bestseller  #taskorea #tasimport #tasimport', 'https://cf.shopee.co.id/file/d464f18d6fd595253d9468151798524f', 'https://cf.shopee.co.id/file/3b510aebc226882adfa617ee6c751150', 0, NULL),
