lastik. Bahan non woven kuat untuk menampung barang berat.\n\nDengan rak portable 4 susun ruang belajar anak atau ruang rumah jadi tersusun rapi\n\nSertakan Warna pada keterangan saat melakukan order, jika tidak menyertakan keterangan Warna akan kami kirim secara acak/random.\n\nHarga Di Atas 1 Pcs\nBerat Satuan: 1.750 Gram\nKode : A339', 'https://ecs7.tokopedia.net/img/cache/700/product-1/2019/7/31/1880521/1880521_d7ba1072-7c98-4d8b-8bcf-1d6168f4ca42_2048_2048', 'https://ecs7.tokopedia.net/img/cache/700/product-1/2019/7/31/1880521/1880521_2c58bd6c-5836-40cd-9124-ddade98eb14e_600_600', 0, NULL),
