roduk: KS147\nWarna: Merah \nMaterial: Stainless steel\n\nNOTE:\n- Tak perlu tanya READY, langsung cek jumlah stok real time di cekcepat.com/stok (mobile friendly). Tinggal masukkan kode produk saja.\n- Mohon cantumkan warna yg diinginkan di note saat checkout + warna alternatif jika kosong. Contoh: Hitam, Merah, Cancel.\nYang tak mencantumkan kami kirimkan random tanpa konfirmasi.\n==============================================\nTIPS BELANJA:\n1. Anda dapat membeli beberapa produk sekaligus karena ongkos kirim dihitung per-kg bukan per-produk. Lihat semua produk kami di tokopedia.com/ahoki\n2. Komitmen kami mengirimkan pada hari yg sama jika invoice diterima sebelum jam 5 sore. Sabtu Jam 2 sore. Minggu & hari besar libur.\n3. Kami sangat welcome Dropship/Reseller. Baca apa & mengapa jadi DS kami di catatan toko.', 'https://ecs7.tokopedia.net/img/cache/700/product-1/2017/8/24/18057625/18057625_2069b4df-724a-4eec-9b99-7514d768816c_790_590.jpg', 'https://ecs7.tokopedia.net/img/cache/700/product-1/2017/8/24/18057625/18057625_211d9c8f-3bb0-4e63-9a7a-b1ba3a30718b_750_499.jpg', 0, NULL),
