tumkan kami kirimkan random tanpa konfirmasi. \n==================================\nTIPS BELANJA: \n1. Anda dapat membeli beberapa produk sekaligus karena ongkos kirim dihitung per-kg bukan per-produk. Lihat semua produk kami di tokopedia.com/ahoki \n2. Komitmen kami mengirimkan pada hari yg sama jika invoice diterima sebelum jam 5 sore. Sabtu Jam 2 sore. Minggu & hari besar libur. \n3. Kami sangat welcome Dropship/Reseller. Baca apa & mengapa jadi DS kami di catatan toko.', 'https://ecs7.tokopedia.net/img/cache/700/product-1/2017/10/2/18057625/18057625_7d09adb7-a888-4de5-84b4-3f13414d0d3c_953_953.jpg', 'https://ecs7.tokopedia.net/img/cache/700/product-1/2017/10/2/18057625/18057625_8241c5c9-8b4d-4524-ab3b-e6ad5f34e855_1134_1864.jpg', 0, NULL),
