tuk penyimpanan, tidak boros tempat, bisa disimpan di kulkas untuk tempat telur atau makanan, juga bisa dibawa ke pasar untuk belanja telur agar telur tidak mudah pecah akibat terbentur \n\nKode : SB053 \nMaterial : PP \nSize : 23 x 15 x 7 cm \nColor : White, Blue, Pink, Green \n\nNOTE: \n- Mohon cantumkan warna yg diinginkan di note saat checkout + warna alternatif jika kosong. Contoh: Hitam, Merah, Cancel. Yang tak mencantumkan kami kirimkan random tanpa konfirmasi. \n============================================== \nTIPS BELANJA: \n1. Anda dapat membeli beberapa produk sekaligus karena ongkos kirim dihitung per-kg bukan per-produk. Lihat semua produk kami di tokopedia.com/ahoki \n2. Komitmen kami mengirimkan pada hari yg sama jika invoice diterima sebelum jam 5 sore. Sabtu Jam 2 sore. Minggu & hari besar libur. \n3. Kami sangat welcome Dropship/Reseller. Baca apa & mengapa jadi', 'https://ecs7.tokopedia.net/img/cache/700/product-1/2017/4/15/18057625/18057625_540207cf-688a-405c-9cdb-88c2e98bef34_750_535.jpg', 'https://ecs7.tokopedia.net/img/cache/700/product-1/2017/4/15/18057625/18057625_ef8918e9-db07-4b4b-b6be-512d35c6aae6_554_541.jpg', 0, NULL),
