('TMS4212', 'TMS', 'https://www.tokopedia.com/mega-persada/keranjang-vintage-desktop-storage-vintage-serbaguna-a646?toko=TMS', NULL, NULL, 'Keranjang Vintage Desktop storage vintage serbaguna A646', 'TMS4212 - Keranjang Vintage Desktop Storage Vintage Serbaguna A646', 'Tersedia', '45000', '63000', '99000', '55', 'Mega-Persada', NULL, NULL, '[\"https:\\/\\/ecs7.tokopedia.net\\/img\\/cache\\/700\\/product-1\\/2019\\/3\\/18\\/1880521\\/1880521_cfbcfcc9-0d01-496f-bcc0-e3c92a0273f5_800_800.jpg\",\"https:\\/\\/ecs7.tokopedia.net\\/img\\/cache\\/700\\/product-1\\/2019\\/3\\/18\\/1880521\\/1880521_942cda10-3305-4193-9cc5-825f4d3ae4e8_800_800.jpg\",\"https:\\/\\/ecs7.tokopedia.net\\/img\\/cache\\/700\\/product-1\\/2019\\/3\\/18\\/1880521\\/1880521_88a689f2-686e-4867-961f-48f1fc382e63_750_491.jpg\",\"https:\\/\\/ecs7.tokopedia.net\\/img\\/cache\\/700\\/product-1\\/2019\\/3\\/18\\/1880521\\/1880521_b6c2764d-a5f4-437f-aee0-ec8e6f15d274_800_800.jpg\"]', 'TIDAK TERMASUK PAJANGAN\n\nBrand : KINBAR\nReady warna putih\nMaterial : WPC\nUkuran : 29.5 CM x 22 CM x 38 CM\n\nKeranjang Vintage Desktop storage vintage serbaguna \n\nProduk berkualitas buatan Mesin, bukan produk buatan tangan sehingga terjamin akurasi dan juga furnishing yang jauh lebih rapi sehingga membuat ruangan rumah anda lebih indah terlihat.\n\nMaterial : WPC\napa itu wpc? Wpc adalah kepanjangan dari wood plastic composite, yang secara bahasa dapat diartikan komposit kayu-plastik. Composite bisa diartikan campuran, jadi wpc adalah campuran antara kayu dan plastik. Sebuah material baru yang tersusun dari elemen kayu dan plastik yang dilebur menjadi satu dan membentuk sebuah material baru, wpc. Bahan anti air, tidak gampang terbakar, mudah dibersihkan.\n\nHarga Di Atas 1 Pcs\nBerat Satuan: 1.050 Gram\nKode : A646', 'https://ecs7.tokopedia.net/img/cache/700/product-1/2019/3/18/1880521/1880521_cfbcfcc9-0d01-496f-bcc0-e3c92a0273f5_800_800.jpg', 'https://ecs7.tokopedia.net/img/cache/700/product-1/2019/3/18/1880521/1880521_9