('TMS2734', 'TMS', 'https://www.tokopedia.com/bloomingdeal/new-calista-otaru-smoke-sealware-14pcs-kuning?toko=TMS', '', '', '[NEW] CALISTA OTARU SMOKE SEALWARE -14pcs - Kuning', 'TMS2734 - [New] Calista Otaru Smoke Sealware 1 Set Isi 14pcs', 'Tersedia', '49900', '75000', '125000', '40', 'Blooming_deal', '', '', '[\"https:\\/\\/ecs7.tokopedia.net\\/img\\/cache\\/700\\/product-1\\/2018\\/2\\/26\\/245908869\\/245908869_abfa3dc7-4c07-415e-8f46-6fd9388704fe_1536_1536.jpg\",\"https:\\/\\/ecs7.tokopedia.net\\/img\\/cache\\/700\\/product-1\\/2018\\/2\\/26\\/245908869\\/245908869_d22c835b-2b54-4ea8-9c5a-6f9c2c3c745f_784_652.jpg\",\"https:\\/\\/ecs7.tokopedia.net\\/img\\/cache\\/700\\/product-1\\/2018\\/2\\/26\\/245908869\\/245908869_b2ecbb14-8be3-4df6-a631-f1b39fa80990_1089_1001.jpg\",\"https:\\/\\/ecs7.tokopedia.net\\/img\\/cache\\/700\\/product-1\\/2018\\/8\\/14\\/1562664\\/1562664_61f2d9a5-33c4-4600-af41-a8250e0387b1_1396_1304.jpg\",\"https:\\/\\/ecs7.tokopedia.net\\/img\\/cache\\/700\\/product-1\\/2018\\/8\\/14\\/1562664\\/1562664_43e6ee13-f306-4bcc-bbe4-b3fde52b2513_1109_928.jpg\"]', '*** NEW & LIMITED EDITION ***\n\n\nTELAH HADIR PRODUK TERBARU DARI CALISTA DENGAN WARNA BADAN HITAM DAN WARNA TUTUP YANG CERAH AKAN MEMBERIKAN KESAN EXCLUSIVE DAN MEWAH.\n\nYUK BURUAN DIORDER YA, STOCK LIMITED..\n\n\nREADY STOCK : UNGU, TOSCA, MERAH, KUNING, HIJAU, PUTIH, BIRU\n\nPACKAGING= KARDUS UNTUK PENGIRIMAN VIA JNE (KAMI PACK 1 SET = 1 KARDUS SUPAYA AMAN SAMPAI TUJUAN)\n\nBAGI YG MAU DROPSHIP TOLONG TULIS NAMA & NO TELP PENGIRIM DI KETERANGAN SAAT ORDER.\n\n\nIsi:\n* 2 x Kontainer 235x155x80 mm\n* 2 x Kontainer 135x135x160 mm\n* 2 x Kontainer 120x120x135 mm\n* 2 x Kontainer 135x135x57,5 mm\n* 2 x Kontainer 120x120x40 mm\n* 2 x Kontainer 115x75x38 mm\n* 2 x Kontainer 90x90x38 mm\n\nSpesifikasi :\n- Bebas BPA (BPA Free)\n- Bisa Digunakan Dalam Microwave dan Freezer\n- Variasi ukuran lengkap\n- Praktis & hemat tempat\n- Polypropylene Plastic\n- Mudah dibawa\n\nBebas BPA\nBPA dikenal sebagai salah satu zat yang memicu timbulnya kanker dan gangguan hormon, khususnya bagi anak-anak. Namun, Anda tidak perlu khawatir, Sealwear keluaran Calista bebas BPA sehingga keluarga Anda pun terlindungi dari bahaya yang mungkin muncul. Sealwear Calista juga dibuat dari Polypropylene yang tidak mengandung bahan kimia yang berbahaya bagi Anda dan keluarga.\n\nBisa Digunakan Dalam Microwave\nDibuat khusus dari bahan plastik polipropilen, kontainer makanan keluaran Calista ini aman untuk digunakan dalam berbagai kondisi. Sealwear ini dibuat khusus supaya bisa digunakan di microwave tanpa mengubah susunan kimia yang bisa menjadi racun bagi tubuh. Selain itu, sealwear ini juga bisa digunakan untuk menyimpan berbagai jenis makanan di kulkas maupun di freezer.\n\nNo retur, cancel dan komplain.\nBarang segel pabrik dan dipacking aman jadi tidak ada komplain kurang isi.', 'https://ecs7.tokopedia.net/img/cache/700/product-1/2018/2/26/245908869/245908869_abfa3dc7-4c07-415e-8f46-6fd9388704fe_1536_1536.jpg', 'https://ecs7.tokopedia.net/img/cache/700/product-1/2018/2/26/245908869/245908869_d22c835b-2b54-4ea8-9c5a-6f9c2c3c745f_784_652.jpg', 0, NULL),
('TMS7119', 'TMS', 'https://www.tokopedia.com/mega-persada/rak-buku-portable-aluminium-rak-serbaguna-5-lapis-a428?toko=TMS', NULL, NULL, 'Rak Buku Portable Aluminium Rak Serbaguna 5 Lapis A428', 'TMS7119 - Rak Buku Portable Aluminium Rak Serbaguna 5 Lapis A428', 'Tersedia', '99000', '128700', '136000', '5', 'Mega-Persada', NULL, NULL, '[\"https:\\/\\/ecs7.tokopedia.net\\/img\\/cache\\/700\\/product-1\\/2018\\/11\\/4\\/1880521\\/1880521_c13f1dc0-baf7-4706-8ddf-3141e9d80b5e_2048_2136.jpg\",\"https:\\/\\/ecs7.tokopedia.net\\/img\\/cache\\/700\\/product-1\\/2017\\/9\\/12\\/1880521\\/1880521_9b0e9de4-7c0b-4f72-8b07-2bed61facf01_2048_0.jpg\"]', 'Bahan : spunbond / Kain furing\nTiang : Aluminium\nUkuran : 49.5 X 28.5 X 151 cm\n\nREADY WARNA:\nCOKLAT\nBIRU NAVY\nABU ABU\n\nRak portable serbaguna 5 Lapis 4 ruang, cocok untuk merapikan buku pelajaran anak agar tersusun rapi dan mudah dicari saat dibutuhkan. Cocok juga untuk tempat majalah, dokumen kantor atau perlengkapan rumah dan dapur.\n\nTerdiri dari 5 Lapis 4 ruang, mudah dibongkar pasang. Bagi anda yang kerjanya sering pindah-pindah lokasi sangat cocok memakai rak ini. Anda tidak perlu beli rak baru tiap pindah lokasi baru, cukup bongkar rak dan simpan di dalam dus kemasan, sangat portable untuk dibawa, berat hanya 2kg.\n\nRak terbuat dari bahan non woven, Bahan non woven kuat untuk menampung barang berat.\n\nDengan rak portable 4 susun ruang belajar anak atau ruang rumah jadi tersusun rapi\n\nSertakan Warna pada keterangan saat melakukan order, jika tidak menyertakan keterangan Warna akan kami kirim secara acak/random.\n\nHarga Di Atas 1 Pcs\nBerat Satuan: 1.800 Gram\nKode : A428', 'https://ecs7.tokopedia.net/img/cache/700/product-1/2018/11/4/1880521/1880521_c13f1dc0-baf7-4706-8ddf-3141e9d80b5e_2048_2136.jpg', 'https://ecs7.tokopedia.net/img/cache/700/product-1/2017/9/12/1880521/1880521_9b0e9de4-7c0b-4f72-8b07-2bed61facf01_2048_0.jpg', 0, NULL),
