('RMS0301', 'RMS', 'https://shopee.co.id/Rak-Dinding-Minimalis-DIY-1set-isi-3pcs-M629-i.12900126.1868975694?toko=RMS', '', '', 'Rak Dinding Minimalis DIY 1set isi 3pcs M629', 'RMS0301 - Rak Dinding Minimalis DIY 1 Set Isi 3pcs', 'tersedia', '40000', '70000', '100000', '30', 'Megamen88 Official Shop', '', '', '[\"https:\\/\\/cf.shopee.co.id\\/file\\/931b57ba51620a7158df8c25be9c8229\",\"https:\\/\\/cf.shopee.co.id\\/file\\/8082ce07a2c7ad3fbf126c83323b8175\",\"https:\\/\\/cf.shopee.co.id\\/file\\/2f81a19cd781cc2601b3df53fa39bc06\",\"https:\\/\\/cf.shopee.co.id\\/file\\/d131b33024a7d54119d88e24bc4b4622\"]', 'TIDAK TERMASUK PAJANGAN\n\nSize produk ada pada foto produk nya ya \nMaterial : WPC\nProduk berkualitas buatan Mesin, bukan produk buatan tangan sehingga terjamin akurasi dan juga furnishing yang jauh lebih rapi sehingga membuat ruangan rumah anda lebih indah terlihat. \n\nMaterial : WPC\napa itu wpc? Wpc adalah kepanjangan dari wood plastic composite, yang secara bahasa dapat diartikan komposit kayu-plastik. Composite bisa diartikan campuran, jadi wpc adalah campuran antara kayu dan plastik. Sebuah material baru yang tersusun dari elemen kayu dan plastik yang dilebur menjadi satu dan membentuk sebuah material baru, wpc.\n\nHarga Di Atas 1 Pcs\nBerat Satuan: 1100 Gram\nKode : M629', 'https://cf.shopee.co.id/file/931b57ba51620a7158df8c25be9c8229', 'https://cf.shopee.co.id/file/8082ce07a2c7ad3fbf126c83323b8175', 0, NULL),
