('TMS1862', 'TMS', 'https://www.tokopedia.com/bloomingdeal/yooyee-leak-proof-grid-lunch-box-sekat-4-mangkok-415?toko=TMS', NULL, NULL, 'YOOYEE LEAK PROOF GRID LUNCH BOX SEKAT 4 + MANGKOK (415)', 'TMS1862 - Yooyee Leak Proof Grid Lunch Box Sekat 4 + Mangkok (415)', 'Tersedia', '48900', '68460', '121000', '75', 'Blooming_deal', NULL, NULL, '[\"https:\\/\\/ecs7.tokopedia.net\\/img\\/cache\\/700\\/product-1\\/2017\\/10\\/31\\/1562664\\/1562664_df9880b4-348d-4895-8047-66ea7e0d3c03_636_640.jpg\",\"https:\\/\\/ecs7.tokopedia.net\\/img\\/cache\\/700\\/product-1\\/2017\\/10\\/31\\/1562664\\/1562664_58fc5209-ce64-4f79-a9cf-575b942606be_999_999.jpg\",\"https:\\/\\/ecs7.tokopedia.net\\/img\\/cache\\/700\\/product-1\\/2017\\/10\\/31\\/1562664\\/1562664_99887038-0545-4c47-923e-89293313baf5_700_700.jpg\",\"https:\\/\\/ecs7.tokopedia.net\\/img\\/cache\\/700\\/product-1\\/2017\\/10\\/31\\/1562664\\/1562664_568cd057-4737-4be4-ab82-2ab8ff49b5c6_800_600.jpg\",\"https:\\/\\/ecs7.tokopedia.net\\/img\\/cache\\/700\\/product-1\\/2017\\/10\\/31\\/1562664\\/1562664_b61d8ea2-21db-4cc9-be56-8754da8e8a12_700_546.jpg\"]', 'Ready Stock: MERAH\n\n- Food Grade PP BPA Free\n- Lunchbox 4 sekat dilengkapi mangkok plastik plus tutup (untuk menyimpan makanan berkuah) dan sendok\n- Bahan berkualitas\n- Tahan panas (microwave) & dingin (kulkas)\n- Terdapat ventilation hole yang dapat dibuka atau ditutup sesuai kebutuhan\n- Ukuran : 23.5 x 17.5 x 6.5 cm\n\n1. Terbuat dari bahan yang berkualitas untuk makanan, aman dan tidak membahayakan, tidak berbau plastik bahkan menggunakan air mendidih di dalamnya.\n2. Dilengkapi mangkok dan tutup (Untuk menyimpan Makanan berkuah) & sendok makan\n3. Bahan berkualitas yang tahan terhadap panas atau dingin, dapat digunakan untuk pemasanan menggunakan microwave, menyimpan pada kulkas, dan mesin cuci piring (Dishwasher)\n4. Terdapat lubang ventilasi yang dapat dibuka atau ditutup sesuai kebutuhan (Lubang ventilasi untuk penguapan digunakan untuk menjaga kadar kelembapan makanan yang panas agar tidak berembun atau basah)', 'https://ecs7.tokopedia.net/img/cache/700/product-1/2017/10/31/1562664/1562664_df9880b4-348d-4895-8047-66ea7e0d3c03_636_640.jpg', 'https://ecs7.tokopedia.net/img/cache/700/product-1/2017/10/31/1562664/1562664_58fc5209-ce64-4f79-a9cf-575b942606be_999_999.jpg', 0, NULL),
('TMS3310', 'TMS', 'https://www.tokopedia.com/bloomingdeal/free-kardus-calista-otaru-sealware-14pcs-biru?toko=TMS', '', '', '[FREE KARDUS] CALISTA OTARU SEALWARE 14PCS - Biru', 'TMS3310 - Tempat Penyimpanan Calista Otaru Sealware 1 Set Isi 14pcs', 'Tersedia', '45900', '71000', '96000', '26', 'Blooming_deal', '', '', '[\"https:\\/\\/ecs7.tokopedia.net\\/img\\/cache\\/700\\/product-1\\/2017\\/1\\/20\\/1562664\\/1562664_907f7465-23da-48b2-b04c-1a2255c3f814_1654_1662.jpg\",\"https:\\/\\/ecs7.tokopedia.net\\/img\\/cache\\/700\\/product-1\\/2018\\/7\\/6\\/1562664\\/1562664_e606f737-4ddc-4bf5-b229-47a3e9bf6145_1383_1188.jpg\",\"https:\\/\\/ecs7.tokopedia.net\\/img\\/cache\\/700\\/product-1\\/2018\\/7\\/6\\/1562664\\/1562664_a49915dd-3a6c-4873-819d-9aafb4e72b7a_1536_1306.jpg\",\"https:\\/\\/ecs7.tokopedia.net\\/img\\/cache\\/700\\/product-1\\/2018\\/7\\/6\\/1562664\\/1562664_e3ea3635-2365-426a-9366-1f37f07785b3_986_711.jpg\",\"https:\\/\\/ecs7.tokopedia.net\\/img\\/cache\\/700\\/product-1\\/2018\\/7\\/6\\/1562664\\/1562664_747da5c3-1f8e-4856-92a0-11bed04b910d_1280_980.jpg\"]', 'CALISTA OTARU SEALWARE -14pcs \n\n\nREADY STOCK :  BIRU, HIJAU, PINK, ORANYE & warna baru: UNGU, MERAH, KUNING\n\nPACKAGING= KARDUS UNTUK PENGIRIMAN VIA JNE (KAMI PACK 1 SET = 1 KARDUS SUPAYA AMAN SAMPAI TUJUAN)\n\n\nBAGI YG MAU DROPSHIP TOLONG TULIS NAMA & NO TELP PENGIRIM DI KETERANGAN SAAT ORDER.\n\n\n\nIsi:\n* 2 x Kontainer 235x155x80 mm\n* 2 x Kontainer 135x135x160 mm\n* 2 x Kontainer 120x120x135 mm\n* 2 x Kontainer 135x135x57,5 mm\n* 2 x Kontainer 120x120x40 mm\n* 2 x Kontainer 115x75x38 mm\n* 2 x Kontainer 90x90x38 mm\n\nSpesifikasi :\n- Bebas BPA\n- Bisa Digunakan Dalam Microwave\n- Variasi ukuran lengkap\n- Praktis & hemat tempat\n- Polypropylene Plastic\n- Mudah dibawa\n- Variasi ukuran lengkap\n\nPilihan Warna: \n-Hijau\n-Biru \n-Pink \n-Oranye\n\nBebas BPA\nBPA dikenal sebagai salah satu zat yang memicu timbulnya kanker dan gangguan hormon, khususnya bagi anak-anak. Namun, Anda tidak perlu khawatir, Sealwear keluaran Calista bebas BPA sehingga keluarga Anda pun terlindungi dari bahaya yang mungkin muncul. Sealwear Calista juga dibuat dari Polypropylene yang tidak mengandung bahan kimia yang berbahaya bagi Anda dan keluarga.\n\nBisa Digunakan Dalam Microwave\nDibuat khusus dari bahan plastik polipropilen, kontainer makanan keluaran Calista ini aman untuk digunakan dalam berbagai kondisi. Sealwear ini dibuat khusus supaya bisa digunakan di microwave tanpa mengubah susunan kimia yang bisa menjadi racun bagi tubuh. Selain itu, sealwear ini juga bisa digunakan untuk menyimpan berbagai jenis makanan di kulkas maupun di freezer.\n\nNo retur, cancel dan komplain.\nBarang segel pabrik dan dipacking aman jadi tidak ada komplain kurang isi.', 'https://ecs7.tokopedia.net/img/cache/700/product-1/2017/1/20/1562664/1562664_907f7465-23da-48b2-b04c-1a2255c3f814_1654_1662.jpg', 'https://ecs7.tokopedia.net/img/cache/700/product-1/2018/7/6/1562664/1562664_e606f737-4ddc-4bf5-b229-47a3e9bf6145_1383_1188.jpg', 0, NULL),
