('TMS8592', 'TMS', 'https://www.tokopedia.com/mega-persada/alat-penyekat-lemari-alat-sekat-laci-fleksibel-ukuran-30-40cm-a592?toko=TMS', '', '', 'Alat Penyekat Lemari / Alat Sekat Laci / Fleksibel Ukuran 30-40CM A592', 'TMS8592 - Alat Penyekat Lemari Alat Sekat Laci Fleksibel Ukuran 30-40cm A592', 'Tersedia', '42000', '58800', '61000', '3', 'Mega-Persada', '', '', '[\"https:\\/\\/ecs7.tokopedia.net\\/img\\/cache\\/700\\/product-1\\/2018\\/10\\/3\\/1880521\\/1880521_6068b61d-5276-43ea-9b5d-77e7ad1c213c_800_800.jpeg\",\"https:\\/\\/ecs7.tokopedia.net\\/img\\/cache\\/700\\/product-1\\/2018\\/10\\/3\\/1880521\\/1880521_3d88e38d-e52b-4ef6-ad68-e004eab1e7ac_750_522.jpeg\",\"https:\\/\\/ecs7.tokopedia.net\\/img\\/cache\\/700\\/product-1\\/2018\\/10\\/3\\/1880521\\/1880521_ea94a65f-1e56-43bb-aa6c-f1a62a8c3376_750_959.jpeg\",\"https:\\/\\/ecs7.tokopedia.net\\/img\\/cache\\/700\\/product-1\\/2018\\/10\\/3\\/1880521\\/1880521_c4d0805b-88f5-43a8-8ed9-803d4f6a7c9d_750_1173.jpeg\",\"https:\\/\\/ecs7.tokopedia.net\\/img\\/cache\\/700\\/product-1\\/2018\\/10\\/3\\/1880521\\/1880521_a3481781-691a-411d-8c1f-4b83ccad41c0_2048_2649.jpg\"]', 'Ready warna \nPUTIH................KOSONG\nBIRU\nPINK\n\nSekat flexible Ukuran 24CM X 30-40CM\n\nSekat flexible berfungsi untuk memberi tambahan sekat pada lemari, dapur, kulkas atau kamar mandi.\nLemari pakaian atau lemari dapur sering kali tidak bisa diisi lebih banyak barang akibat sekat yang tersedia di dalam lemari terbatas sehingga menyisakan banyak ruang yang tidak bisa dipakai.\nDengan sekat flexible, lemari anda jadi bertambah sekat dan bisa diisi lebih banyak barang. Uniknya, sekat flexible ini pasangnya tanpa paku, tanpa bor keramik dan dapat dipanjang pendek.\n\nCara Pasang :\n- Panjangkan sekat flexible hingga menyentuh kedua sisi lemari atau tembok\n- Pasang baut besar berbentuk setengah bulat ke bagian bawah sekat flexible (jika sekat sudah dipanjangkan maksimal), baut berfungsi untuk mengunci pemanjang sekat\n- Pasang sekat, lalu putar pemutar yang terdapat diujung sekat hingga benar-benar nempel kuat\n- Sekat siap dipakai\n\nDilengkapi alas dari bahan plastik PVC yang bisa dipasang di atas sekat, fungsinya untuk menutupi lubang yang terdapat di tengah-tengah sekat agar sekat dapat dipakai untuk tempat barang kecil seperti botol sabun, botol bumbu dan sejenisnya.\n\nJuga dilengkapi 4 pcs baut tambahan, jika sekatnya dipakai untuk tempat barang-barang yang extra berat anda dapat menambah baut ini agar sekat mampu menahan beban barang yang lebih berat.\n\nMaterial : Baja dan lapisan anti karat\n\nSertakan Warna pada keterangan saat melakukan order, jika tidak menyertakan keterangan Warna akan kami kirim secara acak/random.\n\nHarga Di Atas 1 Pcs\nBerat Satuan: 550Gram\nKode : A592', 'https://ecs7.tokopedia.net/img/cache/700/product-1/2018/10/3/1880521/1880521_6068b61d-5276-43ea-9b5d-77e7ad1c213c_800_800.jpeg', 'https://ecs7.tokopedia.net/img/cache/700/product-1/2018/10/3/1880521/1880521_3d88e38d-e52b-4ef6-ad68-e004eab1e7ac_750_522.jpeg', 0, NULL),
